    false,nt"url": null,nt"notes": "This data set contains sensitive biological
    resource data for reptiles and amphibians in coastal Louisiana. Vector polygons
    represent reptile and amphibian habitats, with nest density values by habitat zone
    and parish or management unit. Species-specific abundance, seasonality, status,
    life history, and source information are stored in relational data tables (described
    below) designed to be used in conjunction with this spatial data layer.This data
    set comprises a portion of the Environmental Sensitivity Index (ESI) data for Louisiana.
    ESI data characterize the marine and coastal environments and wildlife by their
    sensitivity to spilled oil. The ESI data include information for three main components:
    shoreline habitats, sensitive biological resources, and human-use resources.",nt"license_title":
